import React from "react";
import "../css/TableSelect.css";

function Table_6seats(){
    return (
        <>
            <div className="row">
                <div className="seat"/>
                <div className="seat"/>
            </div>
                <div className="row">
                    <div className="seat"/>
                    <div className="seat"/>
            </div>
            <div className="row">
                    <div className="seat"/>
                    <div className="seat"/>
            </div>
        </>
    )
}

export default Table_6seats;
